export interface ProductModalViewState {
  mode: 'inactive' | 'active' | 'interacting'
  transitioning: boolean
  transitionStartTime: number
  productEntity: Entity
  productData: ProductComponentType
  productAnchorTransform: TransformComponentType
  targetGroup: Group
}

export const createProductModalView = (productEntity: Entity) => {
  const transform = getComponent(productEntity, TransformComponent)
  const ui = createXRUI(
    EcommerceInteractableModalView,
    createState({
      mode: 'inactive',
      transitioning: false,
      transitionStartTime: 0,
      productEntity: productEntity,
      productData: getComponent(productEntity, ProductComponent),
      productAnchorTransform: {
        position: transform.position.clone(),
        rotation: transform.rotation.clone(),
        scale: transform.scale.clone()
      },
      targetGroup: new Group()
    } as ProductModalViewState)
  )
  return ui
}

